var string = ""
for (var i = 0; i < data.length; i++) {
	for (var j = 0; j < country_codes.length; j++) {
		if (country_codes[j][2] == data[i]["Country"]) {
			string += "'" + country_codes[j][1] + "': {\n";
			population = data[i]["Population"];
			var color_value = Math.floor(population / 160000 * 8);
			if (color_value > 8) {
				color_value = 8;
			}
			string += "	" + "fillKey: " + color_value + ",\n";
			string += "	" + 'name: "' + data[i]["Country"] + '",\n';
			string += "	" + "startOfConflict: " + data[i]["Population"] + '\n';
			if (i != data.length - 1) {
				string += "},\n";
			} else {
				string += "}\n";
			}
		}
	}
}
document.getElementById("output").value = string;